import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h4>{`Summary of demographics and age-dependent parameters.`}</h4>
    <p>{`The second column shows how many people fall into each age group.
The following columns summarize COVID19 severity informed by epidemiological and clinical observations from China.
The column "Confirmed" reflects our assumption on what fraction of infections are reflected in the statistics, the following columns contain the assumption on what fraction of the previous category deteriorates to the next.
Most fields are editable and can be adjusted to different assumptions.
The last column can be used to specify age-group-specific isolation measures.`}</p>
    </MDXLayout>;
}

